  return (
    <SafeAreaView style={styles.container}>

      <View style={{backgroundcolor:"#E8D32E",padding:30,}}>
        <Text style={styles.tilte1}>Panilha</Text>
      </View>
     <View style={styles.container1}>
      <TextInput placeholder="Numero" 
      style={styles.input} value={numero} onChangeText={setNumero}/>

     </View>
    </SafeAreaView>

  );
}
